Spy On The Wildebeest (BBC)

Nature Documentary hosted by David Attenborough, published by BBC in 2007 - English narration


Information
------------------------------

Documentary following a wildebeest calf making a spectacular year-long journey, an arduous 3,000km round trip across Tanzania's Serengeti and Kenya's Masai Mara. Filmed using Dungcam, Bouldercam, Croccam, Skullcam, Tortoisecam and other spycams.


1)  The Journey 
The calf encounters dust-storms, crosses a caustic soda lake and must avoid predators such as lions, cheetahs, hyenas and crocodiles on its perilous migration.

2)  The Crossing 
The migration reaches the Masai Mara where, for the calf, the river presents his greatest challenge yet.

